—ñ.\n7) –°–≤—è–¥–æ–º–∞–µ ‚Äî $consciousCard (45-55 —Å–ª–æ—û): –º—ç—Ç—ã, —á–∞–∫–∞–Ω–Ω—ñ –∞–±–æ —Ç–æ–µ, —à—Ç–æ $userName —É—Å–≤–µ–¥–∞–º–ª—è–µ.\n8) –ë–ª—ñ–∂—ç–π—à–∞—è –±—É–¥—É—á—ã–Ω—è ‚Äî $futureCard (45-55 —Å–ª–æ—û): –≤–µ—Ä–∞–≥–æ–¥–Ω–∞–µ —Ä–∞–∑–≤—ñ—Ü—Ü—ë —û –±–ª—ñ–∂—ç–π—à—ã—è —Ç—ã–¥–Ω—ñ.\n9) –£–Ω—É—Ç—Ä–∞–Ω–∞–µ –Ø ‚Äî $selfCard (45-55 —Å–ª–æ—û): —Å—Ç–∞–Ω, —Ä—ç—Å—É—Ä—Å—ã $userName.\n10) –ê—Å—è—Ä–æ–¥–¥–∑–µ ‚Äî $environmentCard (45-55 —Å–ª–æ—û): —É–ø–ª—ã—û –ª—é–¥–∑–µ–π —ñ –∞–±—Å—Ç–∞–≤—ñ–Ω–∞—û.\n11) –ù–∞–¥–∑–µ—ñ / —Å—Ç—Ä–∞—Ö—ñ ‚Äî $hopesCard (45-55 —Å–ª–æ—û): —á–∞–∫–∞–Ω–Ω—ñ –∞–±–æ —Å—Ç—Ä–∞—Ö—ñ $userName.\n12) –í—ã–Ω—ñ–∫ ‚Äî $outcomeCard (45-55 —Å–ª–æ—û): –≤–µ—Ä–∞–≥–æ–¥–Ω—ã –≤—ã–Ω—ñ–∫ –∑ —É–ª—ñ–∫–∞–º –ø–∞—Ä–∞–¥—ã —Ä–∞—Å–∫–ª–∞–¥—É.\n13) –ó–∞–∫–ª—é—á—ç–Ω–Ω–µ: —Å—è–±—Ä–æ—û—Å–∫–∞—è –ø–∞–¥—Ç—Ä—ã–º–∫–∞ —ñ –ø–∞–∑—ñ—Ç—ã—û–Ω–∞—è –∞—Ñ—ñ—Ä–º–∞—Ü—ã—è (30-35 —Å–ª–æ—û) –¥–ª—è $userName.\n–ü–∞—Ç—Ä–∞–±–∞–≤–∞–Ω–Ω—ñ: –∞–≥—É–ª—å–Ω—ã –∞–±\'—ë–º 400-500 —Å–ª–æ—û, –∂—ã–≤—ã –≥—É—Ç–∞—Ä–∫–æ–≤—ã —Ç–æ–Ω, 4-6 —ç–∑–∞—Ç—ç—Ä—ã—á–Ω—ã—Ö —ç–º–æ–¥–∑—ñ; –∫–æ–∂–Ω—ã –±–ª–æ–∫ –∞–¥–¥–∑—è–ª—è–π –ø–∞–¥–≤–æ–π–Ω—ã–º –ø–µ—Ä–∞–Ω–æ—Å–∞–º —Ä–∞–¥–∫–∞ (\n); –Ω–µ –≤—ã–∫–∞—Ä—ã—Å—Ç–æ—û–≤–∞–π —Å—ñ–º–≤–∞–ª—ã *, # –∞–±–æ —ñ–Ω—à—É—é —Ä–∞–∑–º–µ—Ç–∫—É; –ø—ñ—à—ã —Ç–æ–ª—å–∫—ñ –ø—Ä–æ—Å—Ç—ã–º —Ç—ç–∫—Å—Ç–∞–º.';
